description:
Brandi Belle - Sensual Massage
Added: January 26, 2010

Hi there! So I invited my friend Alexa James to my favorite massage parlor to help me instruct on the best ways to give a massage. I wanted to touch on all the pointers that would allow any therapist do the best job he or she could. It was a fun day full of sensual rubbing and deep tissue satisfaction. I think Alexa had a little more fun than I did to be honest. Watch us get our relaxation on. Enjoy!

